import React, { Component } from 'react';
import {Button, Dialog, Pane} from 'evergreen-ui';

let material_type = (bool = false) => {
  let isShown = bool;

  return (
    <div>
      <Dialog
        isShown={isShown}
        title="Dialog title"
        onCloseComplete={() => {isShown = false}}
        confirmLabel="Custom Label">

        Dialog content
      </Dialog>
      <Button onClick={() => {material_type(true)}}> Material Type 2</Button>
    </div>
  );

}

export {material_type};
